module.exports = a = async ({params}) => {
    console.log('params: ', params);

    try {
        const devices = JSON.parse(params.input);

        if (!Array.isArray(devices)) {
            throw new Error("Parsed input is not an array");
        }

        const deviceEntries = [];
        deviceEntries.push(`Authenticator App`);

        for (const device of devices) {
            const { type, maskedEmail, maskedPhone,  buttonValue } = device;

            if (!type || !buttonValue) continue;


            switch (type.toUpperCase()) {
                case "EMAIL":
                    if (maskedEmail) {
                        deviceEntries.push(`Email: ${maskedEmail}=${buttonValue}`);
                    }
                    break;
                case "SMS":
                    if (maskedPhone) {
                        deviceEntries.push(`Text: ${maskedPhone}=${buttonValue}`);
                    }
                    break;
                case "VOICE":
                    if (maskedPhone) {
                        deviceEntries.push(`Call: ${maskedPhone}=${buttonValue}`);
                    }
                    break;

                default:
                    continue;
            }
        }

        if (deviceEntries.length === 0) {
            throw new Error("No valid MFA devices found.");
        }

        const mfaButtons = deviceEntries.join(',');

        const changeMethod = deviceEntries.length > 1 
            ? `<button
        id="cancel"
        type="button"
        data-skcomponent="skbutton"
        data-skbuttontype="next-event"
        data-skbuttonvalue="CANCEL">
        Change Method
      </button>`
            : "";

        return {
            mfaButtons,
            changeMethod
        };

    } catch (error) {
        console.error("Error parsing input or formatting output: ", error);
        throw new Error("Failed to generate device list string: " + error.message);
    }
}

